snippet.textDisplay:
@Leandro R S O ministro sempre falou que chegaria um momento em que precisaria ter o isolamento social, mas de forma organizada e racional. Tanto que ele disse que o presidente tem razão. Vc assistiu a coletiva completa?
O presidente Bolsonaro sempre defendeu uma proteçao maior aos idosos e às pessoas que tem alguma doença preexistente.
Mas infelizmente, sempre tem alguns que estão mais preocupados em atacar o governo do que contribuir para que as coisas melhorem em nosso país.

